import { useEffect, useState } from 'react';
import axios from 'axios';
import '../App.css';
import { Table, Container } from 'react-bootstrap';
import '../styles/Table.css';

function ShowCities() {
    const [data, setData] = useState({});
    const [error, setError] = useState('');
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        axios.get('/city')
            .then(response => {
                setData(response.data);
                // console.log(response.data)
            })
            .catch(error => {
                console.error("Error fetching data: ", error);
                setError(error);
            })
            .finally( () => {
                setLoading(false)
            })

    }, [])

    if (loading) return (
        <div>
            <h1> Loading...</h1>
        </div>
    )

    let cities = {};
    console.log("DATA:", data);
    // loop inside data querys and count how many diferent citys are.
    // If they are nor inside cities, add them and set the value to 1.
    // If they are inside cities, add 1 to the value.
    if (data) {      
        cities = data;
    }
    console.log("CITIES:", cities)

    return (
        <div className="providerProductsTable__container">
            <Container className="d-flex flex-column gap-3 mt-4">
                <h3> Consulta de radiación UV por ciudad</h3>
                <Table >
                    <thead>
                        <tr>
                            <th >Ciudad</th>
                            <th >Número consultas</th>
                        </tr>
                    </thead>
                    <tbody>
                        {Object.entries(cities).map(([key, value]) => (
                            <tr key={key}>
                                <td >{key}</td>
                                <td >{value}</td>
                            </tr>
                        ))}
                    </tbody>
                </Table>
            </Container>
        </div>
    );
}


export default ShowCities;
